import styled from 'styled-components';
import theme from '../../../theme/theme';

const ProductStyled = styled.div`
  margin-top: 6em;

  div.fildAriane  {
    display: flex;
    justify-content: left;
    align-items: center;

    img {
      width: 20px;
      height: auto;
      transform: rotate(180deg);
      margin-right: .5em;
    }
  }
`;

export default ProductStyled;
